#!/usr/bin/yarn dev
import { createQueue } from 'kue';

const queue = createQueue();

const jobData = {
  phoneNumber: '0123456789',
  message: 'This is the code to verify your account',
};

const job = queue.create('push_notification_code', jobData)
  .save((err) => {
    if (!err) {
